import React from "react"
import reactIconSmall from "../images/react-icon-small.png"

export default function Navbar() {
    return (
        <nav>
            <img className="nav--" src={reactIconSmall} alt="react icon"></img>
            <h3 className="nav--">ReactFacts</h3>
            <h4 className="nav--">React Course - Project 1</h4>
        </nav>
    )
} className="nav--"
